// Init page elements.
var roadcheckbox = document.getElementById('road-checkbox');
var critcheckbox = document.getElementById('crit-checkbox');
var crosscheckbox = document.getElementById('cross-checkbox');
roadcheckbox.checked = true;
critcheckbox.checked = true;
crosscheckbox.checked = true;
// Add some sliders to limit the ages shown, too.
var minSlider = document.getElementById('min-age-slider');
var maxSlider = document.getElementById('max-age-slider');
minSlider.value = 0;
maxSlider.value = 100;

function flatten(geos, filter){
  multipliers = Object.keys(geos).map(citystate => {
    entries = []
    geos[citystate].ages.forEach((age) => {
      if (filter(age)) {
        entries.push({
          name: citystate,
          lat: geos[citystate]['lat'],
          lng: geos[citystate]['lon'],
          age: age
        });
      }
    });
    return entries
  });
  return multipliers.flat(1)
}

var critcities = flatten(critgeos, (a) => true)
var crosscities = flatten(crossgeos, (a) => true)
var roadcities = flatten(roadgeos, (a) => true)

var map = L.map('map').setView([39.5, -98.35], 4);

// Make the map actually a map by adding tiles from openstreetmap.
L.tileLayer('https://tile.openstreetmap.org/{z}/{x}/{y}.png', {
    maxZoom: 19,
    attribution: '&copy; <a href="http://www.openstreetmap.org/copyright">OpenStreetMap</a>'
}).addTo(map);

// Create a few heatmap layers
const radius = 20;
const maxZoom = 10;
const blur = 15;
const intensity = 0.3;

var roadLayer = L.heatLayer(roadcities.map(function(city){
  return [city.lat, city.lng, intensity];
}), {radius: radius, maxZoom: maxZoom, blur: blur});

var critLayer = L.heatLayer(critcities.map(function(city){
  return [city.lat, city.lng, intensity];
}), {radius: radius, maxZoom: maxZoom, blur: blur});

var crossLayer = L.heatLayer(crosscities.map(function(city){
  return [city.lat, city.lng, intensity];
}), {radius: radius, maxZoom: maxZoom, blur: blur});

roadLayer.addTo(map);
critLayer.addTo(map);
crossLayer.addTo(map);

function filterSliders(minage, maxage) {
  // Filter the cities based on the min age
  critcities = flatten(critgeos, (age) => {
    return parseInt(age) > minage && parseInt(age) < maxage;
  });
  // Have to check whether it's displayed, else the layer will panic during redraw.
  // Not perfect since it also won't have an updated list if re-enabled, until slider
  // moves again. Not a big deal tho!
  if (critcheckbox.checked) {
    critLayer.setLatLngs(critcities.map(function(city){
      return [city.lat, city.lng, intensity];
    }));
  }

  roadcities = flatten(roadgeos, (age) => {
    return parseInt(age) > minage && parseInt(age) < maxage;
  });
  if (roadcheckbox.checked) {
    roadLayer.setLatLngs(roadcities.map(function(city){
      return [city.lat, city.lng, intensity];
    }));
  }

  crosscities = flatten(crossgeos, (age) => {
    return parseInt(age) > minage && parseInt(age) < maxage;
  });
  crossLayer.setLatLngs(crosscities.map(function(city){
    return [city.lat, city.lng, intensity];
  }));
}

// Couple event listeners for the sliders.
minSlider.addEventListener('input', function() {
  filterSliders(this.value, maxSlider.value);
});

maxSlider.addEventListener('input', function() {
  filterSliders(minSlider.value, this.value);
});

// Add event listeners to the boxes to update disciplines shown.
[
  {
    box: roadcheckbox,
    layer: roadLayer,
  },
  {
    box: critcheckbox,
    layer: critLayer,
  },
  {
    box: crosscheckbox,
    layer: crossLayer,
  }
].forEach((o) => {
  o.box.addEventListener('change', function() {
    if (o.box.checked) {
      o.layer.addTo(map);
    } else {
      map.removeLayer(o.layer);
    }
  });
});
